import React, { Component } from 'react';
import styles from './contact.module.scss';


class contactPage extends Component{
    render(){
        return <div className={styles.wrap}>
            <h2>contact form</h2>
            <p>Name</p>
            <input name ="name" />
        </div>
    }
}


export default contactPage;
